/* DFP AD GENERAL STYLES */
html, body {
  margin: 0 !important;
  height: 80px;
}

  @media (max-width: 450px) {
  html, body {
  margin: 0 !important;
  height: 120px;
}
  }

body {
  margin: 0;
}

/*
div, span {
  cursor: pointer;
}
*/
a:hover, a:visited, a:link, a:link {
  text-decoration: none;
}

.small_text {
  color: #999999;
  font-size: 11px;
  font-family: "source_sans_pro";
  font-weight: 300;
  display: block;
}

.medium_text {
  font-family: "source_sans_pro";
  font-size: 13px;
  font-weight: normal;
}

.large_text {
  font-family: "source_sans_pro";
  font-size: 22px;
  font-weight: bold;
}

.text_color1 {
  color: #005B9D;
}

.text_color2 {
  color: #37BBE4;
}

.text_color3 {
  color: #666666;
}

.perTradeFootNote {
  font-size: 12px;
  text-align: right;
  line-height: 0px;
  display: block;
}

.inv_adtable_container {
  position: relative;
  display: flex;
  width: 100%;
  height: 100%;
  overflow: hidden;
  max-width: 710px;
  border-bottom: 1px solid #DDD;
  justify-content: flex-start;
  align-items: center;
  padding: 10px 0;
  box-sizing: border-box;
}

/* TABLE ROW SPECIFIC STYLES */
.inv_broker_table_img {
	flex: 1;
    width: 120px;
}
.inv_broker_table_wrapper_2 {
	flex: 3;
    display: flex;
    flex-wrap: wrap;
    justify-content: flex-start;
    align-items: center;
}
.inv_broker_table_col {
	flex: 1;
    display: flex;
    flex-direction: column;
}
.inv_broker_table_col {
	flex: 1;
    padding: 0 5px;
}
.inv_broker_table_col_large {
	flex: 2 1;
}
.inv_logo_image {
  max-width: 150px;
  max-height: 60px;
}
.button {
  display: flex;
  width: 95px;
  height: 30px;
  background-color: #37BBE4;
  border-radius: 5px;
  align-items: center;
  justify-content: center;
  color: #FFFFFF;
  font-family: "source_sans_pro", sans-serif;
  font-weight: normal;
  font-size: 11px;
  font-weight: bold;
  text-transform: uppercase;
  letter-spacing: 2px;
}

.inv_adtable_container:hover .button {
  background: #0B59A2;
}

@media (max-width: 550px) { 
  .inv_broker_table_col_large {
    flex: 100%;
    order: 1;
  }
  .inv_broker_table_button {
  	align-self: flex-end;
  }
 }
  @media (max-width: 450px) {
  .large_text {
  	font-size: 18px;
  }
  .button {
  	width: 80px;
    font-size: 9px;
  }
  .inv_broker_table_button_mobile {
  	display: flex;
  	align-self: flex-end;
  }
}
